import React, { Component } from 'react'

class User extends Component {
  render() {
    return (
      <div>
      <ul>
        <li>Isim :{this.props.name} </li>
        <li>Departman : </li>
        <li>Maas : </li>
      </ul>
      </div>
    )
  }
}
export default User;
